import React, { Component } from 'react';
import VideoPlayer from 'react-simple-video-player';
import LayoutTemplateTestimonial from './LayoutTemplateTestimonial.jsx';

export default class LayoutTemplateIntroduce extends Component {

    constructor(props) {
        super(props);
        this.state = {
        }
    }


    render() {

        return (
            <div style={{ width: "100%", height: "100%" }} >
                <div class="row">
                        <div class="section-heading alteration-fancy-heading">
                            <div class="heading">
                            <span style={{fontSize:"40px"}}>WE LOVE OUR CUSTOMERS</span>
                                <span class="subheading">Ceci'Style</span>
                            </div>
                        </div>
                </div>
                <div class="row" style={{ display: "flex" }}>
                    <div style={{ width: "48%", height: "100%" }}>
                        <div class="col-sm-3" />
                        <div class="col-sm-6" style={{ display: "inline-table" }}>
                            <VideoPlayer url="../videos/videocristina.mp4" poster="/myPoster.png" width={720} height={540} autoplay />
                        </div>
                        <div class="col-sm-3" />
                    </div>
                    <div style={{ width: "48%", height: "100%" }}>
                        <LayoutTemplateTestimonial primaryColor={"rgb(147,0,80)"} />
                    </div>
                </div>

            </div>
        )
    }
}
